import React from "react";
import classes from "./Vaults.module.scss";
import VaultsInput from "../../components/VaultsInput/VaultsInput";
import VaultsTable from "./VaultsTable/VaultsTable";
import MyVaultsTable from "./MyVaultsTable/VaultsTable";
import { motion } from "framer-motion";
import NotFound from "../../components/not-found";
import { StatesContext } from "../../App";

const Vaults = () => {
  const { isNotFound, setIsVaultsToggle, isBtnActive } =
    React.useContext(StatesContext);

  const [isNetworsMsg, setIsNetworsMsg] = React.useState(true);

  const handlerVaultToggler = (vaultsNamber) => {
    if (vaultsNamber === "all vaults") {
      setIsVaultsToggle("all vaults");
    } else {
      setIsVaultsToggle("my vaults");
    }
  };

  const handlerIsNetworsMsg = () => {
    setIsNetworsMsg(!isNetworsMsg);
  };

  React.useEffect(() => {
    const vaultsinfoId = document.getElementById("vaults");
    if (vaultsinfoId)
      window.scrollTo({
        top: 0,
        left: 0,
        behavior: "smooth",
      });
  }, []);

  return (
    <motion.div
      className={classes.Vaults}
      initial={{ opacity: 0 }}
      animate={{ opacity: 1, transition: { duration: 1 } }}
      id="vaults"
      onClick={() => {}}
    >
      {isNetworsMsg && (
        <div className={classes.networkMsg__wrapper}>
          <div className={classes.networkMsg__head}>
            <svg
              width="72"
              height="64"
              viewBox="0 0 72 64"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
              xmlnsXlink="http://www.w3.org/1999/xlink"
            >
              <rect y="0.5" width="72" height="63.1495" fill="url(#pattern0)" />
              <defs>
                <pattern
                  id="pattern0"
                  patternContentUnits="objectBoundingBox"
                  width="1"
                  height="1"
                >
                  <use
                    xlinkHref="#image0_327_21090"
                    transform="scale(0.00332226 0.00378788)"
                  />
                </pattern>
                <image
                  id="image0_327_21090"
                  width="301"
                  height="264"
                  xlinkHref="data:image/png;base64,"
                />
              </defs>
            </svg>
            <p className={classes.networkMsg__head_text}>
              You are currently connected to the network that cannot interact
              with this DApp
            </p>
            <button
              type="button"
              className={classes.networkMsg__head_close__btn}
              onClick={() => handlerIsNetworsMsg()}
            >
              <svg
                className={classes.networkMsg__head_close__icon}
                viewBox="0 0 24 24"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  d="M8 16.5L16 8.49997"
                  stroke="#E5E8DF"
                  strokeWidth="2"
                  strokeLinecap="round"
                />
                <path
                  d="M16 16.5L7.99997 8.49997"
                  stroke="#E5E8DF"
                  strokeWidth="2"
                  strokeLinecap="round"
                />
              </svg>
            </button>
          </div>
          <button type="button" className={classes.networkMsg__button}>
            Change network
          </button>
        </div>
      )}
      <VaultsInput handlerVaultToggler={handlerVaultToggler} />
      {isBtnActive === "001" && !isNotFound && <VaultsTable />}
      {isBtnActive === "002" && !isNotFound && <MyVaultsTable />}
      {isNotFound && <NotFound />}
    </motion.div>
  );
};

export default Vaults;
